




use master
go
if exists(select * from sysdatabases where name='QLNS')
	drop database QLNS
go
create database QLNS
go
use QLNS
go





create table Department (
	Department INT,
	DepartmentName VARCHAR(50),
		PRIMARY KEY (Department)

);




create table Staff (
	StaffId INT,
	StaffName VARCHAR(50),
	Department INT,
	StaffMail VARCHAR(50),
	PRIMARY KEY (StaffId),
	FOREIGN KEY (Department) REFERENCES Department (Department)
);
